Temple Houston is a gun-toting District Attorney whose heart lies with the cause of justice but whose actions toward that end can be controversial. Bigelow is a railroad agent who frames a Cherokee Chief for the murder of the Indian Commissioner. The crafty Bigelow wants the Cherokee nation to declare war, which would make their lands automatically available for use by the railroad according to an 1867 treaty. Temple Houston has to prosecute the Chief, a long-time friend, and although he wins his case the story is not over yet. As he soon discovers, the Chief is most decidedly innocent.


